import React,{useState,useEffect,selectChange,cardSelector,Component} from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';
import Device from './Device';
import icon1 from './images/icon1a.svg';
import icon2 from './images/icon2p.svg';
import icon3 from './images/icon3p.svg';
import Grid from '@material-ui/core/Grid';
import { Card, CardMedia, CardContent, CardActions, IconButton,CardHeader,Avatar } from '@material-ui/core';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import './style.css';
  

class Home extends Component {


  render(){

  return (
    
    <div>
        <Navbar1/>
        <div className="container4">
        <div className="menu">
          <div className="iconslist">
            <div className="icons">
              <img src={icon1} />
              <a className="iconlabel">Home</a>
            </div>
            <div className="icons">
              <img src={icon2}/>
              <a className="iconlabel">Devices</a>
            </div><div className="icons">
              <img src={icon3}/>
              <a className="iconlabel">Report</a>
            </div>
          </div>
        </div>
        <Device/>
        <div className="analytics">
          <h3>Analytics</h3>
            <div className="container5"></div>
        </div>
        </div>
    </div>
  );
            }
};

export default Home;
